import React from 'react'
import Container from "react-bootstrap/Container";

import Home from './Components/Home';
import Skills from './Components/Skills';
import Project from './Components/Project';

import './App.css';
import 'bootstrap/dist/css/bootstrap-grid.min.css';
import {Breadcrumb} from "react-bootstrap";

class App extends React.Component {

    constructor(props, context) {
        super(props, context);
        this.state = {
            currentComponent: <Home/>,
        }

        this.changeCurrentComponent = this.changeCurrentComponent.bind(this);

    }

    changeCurrentComponent(event) {
        switch (event) {
            case 'Home':
                this.setState({currentComponent: <Home/>});
                break;

            case 'Skills':
                this.setState({currentComponent: <Skills/>});
                break;

            case 'Project':
                this.setState({currentComponent: <Project/>})
                break;

            default:
                this.setState({currentComponent: <Home/>});
                break;
        }
    }

    render() {
        return (
            <Container fluid>
                <Breadcrumb>
                    <Breadcrumb.Item>
                        Home
                    </Breadcrumb.Item>
                    <Breadcrumb.Item>
                        Skills
                    </Breadcrumb.Item>
                    <Breadcrumb.Item>
                        Project
                    </Breadcrumb.Item>
                </Breadcrumb>
            </Container>
        )
    }
}

export default App;
